import Navigation from "./navigation";

function Layout({ children }) {
  return (
    <div>
      <Head>
        <title>Berat Yıldırım'ın Web Sitesi</title>
      </Head>
      <Navigation />
      <main>{children}</main>
      <footer>Berat'ın sayfası</footer>
    </div>
  );
}
export default Layout;
